import React,{ Component } from "react";

class SearchBar extends Component{
    constructor(props){
        super(props);
    }
    render(){
        console.info('SearchBar render()');
        return(
            <div className='container'>
                <div className='row'>
                    <div className='col'>
                        <form className='card card-sm'>
                            <div className='card-body row align-items-center'>
                                <div className='col-auto'>
                                    
                                </div>

                            </div>
                            <div className='col'>
                            <input type='text' name='youtube-search' placeholder='input Search words'/> 
                            </div>
                            <div className='col-auto'>
                                <button type='submit' className='btn btn-sm btn-outline-info'>search</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default SearchBar;
